import "bootstrap/dist/css/bootstrap.min.css";
import { Accordion} from 'react-bootstrap'
function Accord(){
    return(
      <Accordion>
        <Accordion.Item eventKey='0'>
          <Accordion.Header>item</Accordion.Header>
          <Accordion.Body>
            hello
          </Accordion.Body>
        </Accordion.Item>
      </Accordion>
    )
}
export default Accord;
